  const renderProductCards = () => {
    if (loading) {
      return <p>Loading...</p>;
    }

    if (
      !productsData ||
      !productsData.products ||
      productsData.products.length === 0
    ) {
      return <p>No products available.</p>;
    }

    return productsData.products.map((product) => (
      <div className="">
        <div className="card p-1 m-3 " key={product._id}>
          <Link to={`/products/${product._id}`}>
            <img
              src={`/public/images/Women/${product.category}/${product.name}-black.jpg`}
              alt={product.name}
